import React from 'react';

// const Wrapper = ({children}) => children;

const MyName = () => {
    return (
        <div className='flex-grid'>
            <div className='col'></div>
            <div className='col' style={{display: 'flex', flex: '1 0 auto', flexDirection: 'column', justifyContent: 'center'}}>
                <h1 className='my-name'>Christopher Nicholas Reeves</h1>
                <p className='my-title'>undefined</p>
            </div>
            <div className='col'></div>
        </div>
    )
}

export default MyName;
